import logo from './logo.svg';
import './App.css';
import {HashRouter,Router,Route}  from "react-router-dom"
import { Course } from './Layout/Course';
function App() {
  return (
      <div>
        <HashRouter>
          <Router>
            <Route path="course" element={Course} />
          </Router>
        </HashRouter>
      </div>
  );
}

export default App;
